import React from "react";
import { View, Text, TouchableOpacity } from "react-native";
import StylePassCentre from "./StylePasswordCenter";

const PasswordCenter =()=>{
    return<View style={StylePassCentre.passConteiner}>
        <TouchableOpacity style={StylePassCentre.switchOn} ><Text style={StylePassCentre.styleText} >Off lock code</Text></TouchableOpacity>
        <TouchableOpacity style={StylePassCentre.switchOn} ><Text>Edit lock code</Text></TouchableOpacity>
        <TouchableOpacity style={StylePassCentre.switchOn} ><Text>Unlock to Face or Touch id</Text></TouchableOpacity>
    </View>
}

export default PasswordCenter;
